import React from "react";
import { useNavigate } from "react-router-dom";
import "./Home.css";

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="home-container">
      <nav className="navbar">
        <h1>Alzheimer’s Disease Detection</h1>
      </nav>
      
      <div className="home-content">
        <h2>Early Detection of Alzheimer’s Disease</h2>
        <p>
          Our AI-powered system helps detect Alzheimer’s Disease using advanced machine learning models.
          Enter relevant health features to get an accurate prediction.
        </p>
        <button className="start-button" onClick={() => navigate("/auth")}>
          Get Started
        </button>
      </div>
    </div>
  );
};

export default Home;
